import './App.css';
import React ,{Component} from 'react';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import Login from './pages/Login'
function App() {
  return (
    <div className="App">
       <Router>
         <switch>
           <Route path='/login' Component={Login}></Route>
         </switch>
       </Router>
    </div>
  );
}

export default App;
